import React from 'react';
import Table from 'react-bootstrap/Table';

export default class PostTable extends React.Component{

    render() {
      // console.log(this.props.className);
      // console.log(this.props.classDescription);
        return(
            <div>
                <h1>{this.props.className}</h1>
                <p>{this.props.classDescription}</p>

                <Table striped bordered hover>
                    <tr>
                      <th>Post ID</th>
                      <th>Post Title</th>
                      <th>Notes</th>
                    </tr>
                <tr>
                    <td>{this.props.post_ID}</td>
                  <td>{this.props.post_Title}</td>
                  <td>{this.props.post_note}</td>

                </tr>
                </Table>
            </div>
        );

    }
}
